import bus from '../../../components/common/bus';
export default {
    data() {
        return {
            collapse: false,
            items: [
                {
                    icon: 'el-icon-lx-home',
                    index: 'dashboard',
                    title: '系统首页'
                },
                {
                    icon: 'el-icon-lx-cascades',
                    index: 'table',
                    title: '预约练车'
                },
                {
                    icon: 'el-icon-lx-copy',
                    index: 'tabs',
                    title: 'tab选项卡'
                },
                {
                    icon: 'el-icon-lx-calendar',
                    index: '3',
                    title: '预约练车',
                    subs: [
                        {
                            index: 'form',
                            title: '预约教练'
                        },
                        {
                            index: 'table',
                            title: '预约记录'
                        },
                        {
                            index: 'process',
                            title: '预约流程'
                        }
                    ]
                },
                {
                    icon: 'el-icon-lx-emoji',
                    index: 'icon',
                    title: '自定义图标'
                },
                {
                    icon: 'el-icon-pie-chart',
                    index: 'charts',
                    title: 'schart图表'
                },
                {
                    icon: 'el-icon-rank',
                    index: '6',
                    title: '我的教练',
                    subs: [
                        {
                            index: 'drag',
                            title: '教练信息'
                        },
                        {
                            index: 'dialog',
                            title: '教练学员'
                        }
                        ,
